//sending message to child window
const openTab = (url, index) => {
  const childWin = window.open(url, index);
  window.addEventListener(
    "message",
    (event) => {
      if (event.data.type == "READY") {
        childWin.postMessage({
          type: "LOAD_DOCUMENT",
          payload: MY_JSON_FILE.data.attachments[childWin.name].data,
        });
      }
    },
    false
  );
};

